 // not call when click happenned on child\n *  | \n *  \n */\n@Directive({\n  selector: '[defi-click-stop-propagation]'\n})\nexport class DefiClickStopPropagation {\n  /**\n   * Trigger click event to stop propagation\n   */\n  @HostListener('click', ['$event'])\n  public onClick(event: any): void {\n    event.stopPropagation();\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules/DefiContainersModule.html":{"url":"modules/DefiContainersModule.html","title":"module - DefiContainersModule","body":"\n                   \n\n\n\n\n  Modules\n  DefiContainersModule\n\n\n      \n          \n              \n\n\n\n\n\ndependencies\n\nLegend\n\n Declarations\n\n Module\n\n Bootstrap\n\n Providers\n\n Exports\n\ncluster_DefiContainersModule\n\n\n\ncluster_DefiContainersModule_declarations\n\n\n\ncluster_DefiContainersModule_exports\n\n\n\n\nDefiBoxComponent\n\nDefiBoxComponent\n\n\n\nDefiContainersModule\n\nDefiContainersModule\n\nDefiContainersModule -->\n\nDefiBoxComponent->DefiContainersModule\n\n\n\n\n\nPanelComponent\n\nPanelComponent\n\nDefiContainersModule -->\n\nPanelComponent->DefiContainersModule\n\n\n\n\n\nDefiBoxComponent \n\nDefiBoxComponent \n\nDefiBoxComponent  -->\n\nDefiContainersModule->DefiBoxComponent \n\n\n\n\n\nPanelComponent \n\nPanelComponent \n\nPanelComponent  -->\n\nDefiContainersModule->PanelComponent \n\n\n\n\n\n\n          \n          \n          \n              Zoom in\n              Reset\n              Zoom out\n          \n      \n      \n      \n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            src/app/modules/containers/containers.module.ts\n        \n\n\n        \n\n        \n            \n                \n                    Declarations\n                    \n                            \n                                DefiBoxCom